    uint16 midterm;
    uint16 finalExam;
    uint16 average;
    bool isMidtermSet;
    bool isFinalExamSet;
}

struct CourseSection {
    uint16 courseSectionId;
    bool isCourseSectionExisted;
    Score score;
}

enum ScoreType {
    Midterm,
    FinalExam
}

